import React from 'react';
import Item from '../../Item/Item';
import '../../Item/Item.css'

const cafe_denUrl = `${process.env.PUBLIC_URL}/img/cafe_den.png`
const bacxiuUrl = `${process.env.PUBLIC_URL}/img/bac_xiu.png`
const cafe_suaUrl = `${process.env.PUBLIC_URL}/img/cafe_sua.png`
const kemlyUrl = `${process.env.PUBLIC_URL}/img/kemly.png`



function SuggestBox(props) {
    return (
        <div className='SuggestBox'>
            <Item linkURL={cafe_denUrl} className='SuggestBox-Item' />
            <Item linkURL={bacxiuUrl} className='SuggestBox-Item' />
            <Item linkURL={cafe_suaUrl} className='SuggestBox-Item' />
            <Item linkURL={kemlyUrl} className='SuggestBox-Item' />
            <Item linkURL={cafe_denUrl} className='SuggestBox-Item' />
            <Item linkURL={bacxiuUrl} className='SuggestBox-Item' />
            <Item linkURL={cafe_suaUrl} className='SuggestBox-Item' />
            <Item linkURL={kemlyUrl} className='SuggestBox-Item' />
        </div>
    );
}

export default SuggestBox;
